import React from "react"
import { Link } from 'react-router-dom';

function NavBar(){
    return (
        <nav className="navbar">
        <h1>Bloggin Blog</h1>
        <div className="links">
          <Link to="/Home">Home</Link>
          <Link to="/surfspot">Surf Spot</Link>
          <Link to="/newSpot">New Spot</Link>
        </div>
      </nav>
    )
}

export default NavBar;
